import React, { useEffect } from 'react'
import './Header.css';

import logo from "/My project/ca/src/Assets/ca-logo.png";
// import heading from "/My project/ca/src/Assets/cheading.png";


function Header() {
    // useEffect(()=>{
    //     const menuIcon = document.querySelector(".hamburger__menu");
    //   const navbar = document.querySelector(".navbar");

    //   menuIcon.addEventListener("click", () => {
    //       navbar.classList.toggle('change');
    //   });
    // })
      

    function openNav() {
        document.getElementById("mySidenav").style.width = "100%";
      }
      
      function closeNav(e) {
          e.preventDefault();
        document.getElementById("mySidenav").style.width = "0";
      }

    return (
        <div>
        <div className="header">
            <div className="header__left">
                <div className="header__logo">
                <img src={logo} alt="" />
                </div>
            </div>

            <div className="header__right">
                <ul>
                    <li>Home</li>
                    <li>About us</li>
                    <li>Services</li>
                    <li>Blogs</li>
                    <li>Contact us</li>
                </ul>
                <button className="header__right_button">Call us</button>

            </div>
        </div>

         <div className="container">
             <nav className="navbar">
                 <div className="hamburger__menu">
                     <div className="hamburger__line"></div>
                     <div className="hamburger__line"></div>
                     <div className="hamburger__line"></div>
                 </div>
                 <ul className="hamburger__navlist">
                     <li className="hamburger__navitem">
                         <a href="aa" className="hamburger__navlink">Home</a>
                     </li>
                     <li className="hamburger__navitem">
                         <a href="ab" className="hamburger__navlink">Home</a>
                     </li>
                     <li className="hamburger__navitem">
                         <a href="ac" className="hamburger__navlink">Home</a>
                     </li>
                     <li className="hamburger__navitem">
                         <a href="ad" className="hamburger__navlink">Home</a>
                     </li>
                 </ul>
             </nav>
         </div>

        <div>
        <div id="mySidenav" className="sidenav">
  <a href="a" className="closebtn" onClick={closeNav}>&times;</a>
        <div className="header__right">
                 <ul>
                     <li>Home</li>
                     <li>About us</li>
                     <li>Services</li>
                     <li>Blogs</li>
                     <li>Contact us</li>
                 </ul>
                 <button className="header__right_button">Call us</button>
        </div>
</div>



<span style={{fontSize:"30px",cursor:"pointer",float:"right"}} onClick={openNav}>&#9776;</span>
</div>
</div>
    )
};

export default Header;
